import { Route, useParams } from "react-router-dom";
import { CarVariants } from "../interface";
import { useState, useEffect } from "react";

export function CarDetails(){
    const[carDetails, setCarDetails] = useState<CarVariants[] | any>();
    const { id } = useParams<any>();

    const getCarDetails = async() => {
        const response = await fetch(
            "http://localhost:8000/website/cars/variants/",
            {
                method: "GET"
            }
            );
            const data = await response.json();
            // console.log(data);
            data.filter((cardetails:any)=>(cardetails.car.id)===id)
            setCarDetails(data.filter((cardetails:any)=>(cardetails.car.id)===id));
        }

        useEffect(() => {
            getCarDetails();
        }, []);
    return(
        <div>
            <Route exact path="">

                <h1 className="heading-detail">{carDetails.car}</h1>
            </Route>

        </div>
    );
}
